import React from 'react';
import { StyledItem, ImageContainer, Image } from './StyledMenu';



const Item = ({ photo, name, description, price }) => {
    console.log(photo, name, description, price)
    return (
        <StyledItem>
            <ImageContainer >
                <Image image={photo} />
            </ImageContainer>
            <h5>{name}</h5>
            <p>{description}</p>
            <p>{`${price} VND`}</p>
            <button>ADD TO CART</button>
        </StyledItem>
    )
}

export default Item;
